import React from "react"
import { TiCodeOutline } from "react-icons/ti";
import Game from "./Game"

export default function GameGenre({ gamesGenre }) {
    
    return (
        <div>
            {
                gamesGenre.map(game => {
                    <Game game={game.genre} />
                })
            }
        </div>
    );
}
